{
    org.traccar.helper.Parser parser = new org.traccar.helper.Parser(org.traccar.protocol.Gl200ProtocolDecoder.PATTERN_WIF, sentence);
    if (!parser.matches()) {
        return null;
    }
    org.traccar.DeviceSession deviceSession = getDeviceSession(channel, remoteAddress, parser.next());
    if (deviceSession == null) {
        return null;
    }
    org.traccar.model.Position position = new org.traccar.model.Position();
    position.setProtocol(getProtocolName());
    position.setDeviceId(deviceSession.getDeviceId());
    getLastLocation(position, null);
    org.traccar.model.Network network = new org.traccar.model.Network();
    parser.nextInt();
    java.util.regex.Matcher matcher = java.util.regex.Pattern.compile("([0-9a-fA-F]{12}),(-?\\d+),,,,").matcher(parser.next());
    while (matcher.find()) {
        java.lang.String mac = matcher.group(1).replaceAll("(..)", "$1:");
        network.addWifiAccessPoint(org.traccar.model.WifiAccessPoint.from(mac.substring(0, mac.length() - 1), java.lang.Integer.parseInt(matcher.group(2))));
    } 
    position.setNetwork(network);
    position.set(Position.KEY_BATTERY, parser.nextInt());
    return position;
}

